class HomeCategoryDto {
  HomeCategoryDto({
    this.categoryId,
    this.name,
    this.image,
    this.mobileImage,
    this.bannerImage,
    this.cards,
  });

  HomeCategoryDto.fromJson(dynamic json) {
    categoryId = json['categoryId'];
    name = json['name'];
    image = json['image'];
    mobileImage = json['mobileImage'];
    bannerImage = json['bannerImage'];
    if (json['cards'] != null) {
      cards = [];
      json['cards'].forEach((v) {
        cards?.add(CategoryCard.fromJson(v));
      });
    }
  }
  int? categoryId;
  String? name;
  String? image;
  String? mobileImage;
  String? bannerImage;
  List<CategoryCard>? cards;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['categoryId'] = categoryId;
    map['name'] = name;
    map['image'] = image;
    map['mobileImage'] = mobileImage;
    map['bannerImage'] = bannerImage;
    if (cards != null) {
      map['cards'] = cards?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

